This dataset is a demo visual instruct dataset.
You can organize content in the dataset_info.json in LLaMA Factory like this:
"mllm_demo_hf": {
  "hf_hub_url": "BUAADreamer/mllm_demo",
  "formatting": "sharegpt",
  "columns": {
    "messages": "messages",
    "images": "images"
  },
  "tags": {
    "role_tag": "role",
    "content_tag": "content",
    "user_tag": "user",
    "assistant_tag": "assistant"
  }
}

Then you can use it in LLaMA Factory by specifying --dataset mllm_demo_hf.

Source Paper: https://arxiv.org/abs/2305.10738
